function drawImage(ind, px, py) {
  if(nrm.checked == true) {
    x1=1,x2=1,y1=1,y2=1,
    orn0=0,orn1=1,orn2=2,orn3=3;
  } else if (rig.checked == true) {
    x1=-1,x2=-1,y1=1,y2=1,
    orn0=1,orn1=0,orn2=3,orn3=2;
  } else if (lef.checked == true) {
    x1=1,x2=1,y1=-1,y2=-1,
    orn0=1,orn1=0,orn2=3,orn3=2;
  } else if (usd.checked == true) {
    x1=-1,x2=-1,y1=-1,y2=-1,
    orn0=0,orn1=1,orn2=2,orn3=3;}
    if (alli.checked == true) {
    imageScale = sp.innerText;
  } else {
    imageScale = imgDs[ind][0];
  }
  setTimeout(function() {
    var a = new ArrayBuffer(9),
      n = new DataView(a);
    if((px + imgData[ind][drawIndex][orn1]*x1*imageScale)< 0||
    (py + imgData[ind][drawIndex][orn0]*y1*imageScale)< 0||
    (px + imgData[ind][drawIndex][orn3]*x2*imageScale)< 0||
    (py + imgData[ind][drawIndex][orn2]*y2*imageScale)< 0){
    iS=0;
    }else{iS=imageScale};
       n.setUint8(0, 3),
      n.setUint16(1, px + imgData[ind][drawIndex][orn1] * x1 * iS, !0),
      n.setUint16(3, py + imgData[ind][drawIndex][orn0] * y1 * iS, !0),
      n.setUint16(5, px + imgData[ind][drawIndex][orn3] * x2 * iS, !0),
      n.setUint16(7, py + imgData[ind][drawIndex][orn2] * y2 * iS, !0);
    if (drau == 0) {
      e.send(a);
    } else if (drau == 1) {
      L[0].send(a);
    } else {
      L[1].send(a);
    }
    drau++;
    if (drau > 2) {
      drau = 0;
    }
    ++drawIndex;
    if (drawIndex < imgData[ind].length) {
      drawImage(ind, px, py);
    } else {
      drawIndex = 0;
    }
  }, 15);
}

